import React, { Component } from 'react';
import UsersSquares from '../usersSquares/UsersSquares';
import User from '../../models/User';


interface usersState {
    allUsers : User[];
    filteredUsers : User[];
}

export default class Home extends Component <any, usersState> {

    constructor(props : any) {
        super(props);

        this.state = {
            allUsers: [
                new User("Ben", 23, "male", false),
                new User("Ben", 23, "male", true),
                new User("Ben", 23, "male", false),
                new User("Ben", 23, "male", false),
                new User("Ben", 23, "male", true),
                new User("Ben", 23, "male", false),
                new User("Ben", 23, "male", true),
            ],
            filteredUsers : new Array <User> ()
        };
    }

    render() {
        return (
            <div>
                <UsersSquares allUsers={this.state.allUsers} />
            </div>
        )
    }
}
